import Landing from "./sections/Landing";
import ElectionList from "./sections/ElectionList";
import ScrollTextLand from "./components/ScrollTextLand";

const Home = () => {
  return (
    <>
      <Landing />

      <ScrollTextLand
        word={"Join our discord channel and help grow our codebase"}
      />
      <ElectionList />
    </>
  );
};

export default Home;
